drop table esglesia;

create table esglesia (
id smallint primary key,
nom varchar(100) not null,
municipi varchar(100) null,
wikidata varchar(15) null,
wikipedia varchar(100) null,
lat decimal(9,7) null,
lon decimal(9,7) null,
osm_id varchar(12),
osm_tipus varchar(10)
);

